import LoginForm from '../components/LoginForm';

const Home = () => {
    const [isLoggedIn, setisLoggedIn] = useState(1);

    return (
      <>
        {isLoggedIn ? <AppLayout /> : <LoginForm />}
      </>
    );
}

export default Home;
